import React from 'react';
import Tilt from 'react-tilt'
 

const Logo = () => {
	return(
		<div className="ma4 mt0">
			<Tilt className="Tilt" options={{ max : 25 }} style={{ height: 150, width: 150 }} >
			 <div className="Tilt-inner"><img src="https://github.com/aneagoie/face-recognition-brain/blob/master/src/components/Logo/brain.png"/></div>
			</Tilt>
		</div>
	);
}

export default Logo;
